  return (
    <div className="App">
      {/* ------------------------------- home ------------------------------------ */}
      <div id="animation">
        <img id="gif1" src={gif1} alt="guile" />
        <button id="button">Play</button>
        <img id="gif2" src={gif2} alt="ken" />
      </div>
      {/* ------------------------------- home ------------------------------------ */}
    </div>
  );
}

export default App;
